import React, { useState, useEffect, useContext } from 'react'
import "./Feladat.css";
import ButtonBack from '../buttons/ButtonBack'
import iconFeladat from '../../assets/iconFeladat.png'


let element

function Feladat(props) {


  const click = (element) => {
    props.feladatokClick(element)
  }

  return (
    <div>
      <div id="feladat" className={props.feladatokVisibility}>
        <h2>A feladat</h2>
        <div id = 'pickerFeladat'>
        {props.feladatList != undefined ? element = props.feladatList.map((feladat, index) => (
              <ul key={index} >
                <p>{feladat[index]}</p>
                </ul>
            )) : null
          }}
        </div>
      </div>
    </div>
    );


}

export default Feladat;
